import React from "react";
import ImageCarousel from "./components/ImageCarousel";
import GamePresenter from "./components/GamePresenter";
import "./styles/App.css";
import './styles/TutorialOverlay.css';
import IconDebug from './components/IconDebug';

function App() {
  return (
    <div className="app-container">
      <div className="app-carousel">
        <ImageCarousel />
      </div>
      <div className="app-question-card">
        <GamePresenter />
      </div>
      <main className="app-content">
        <IconDebug />
        <AWSArchitectureDisplay 
          architecture={testArchitecture}
          missingServices={['ec2']}
          onServiceClick={(id) => console.log('Clicked service:', id)}
        />
      </main>
    </div>
  );
}

export default App;
